import React, {useState} from 'react'
import {Link} from 'react-router-dom'
import './Navbar.css'

function Navbar(){
    const [click, setClick] = useState(false)
    const handleCLick = () => setClick(!click)
    const closeMobileMenu = () => setClick(false);


    return (
        <>
        <nav className='navbar'>
        <ul class="nav">
  <li class="nav-item">
    <Link class="nav-link active" to='/' onClick={closeMobileMenu}>Inicio</Link>
  </li>
  <li class="nav-item">
    <Link class="nav-link" to='/usuarios' onClick={closeMobileMenu}>Usuarios</Link>
  </li>
  <li class="nav-item">
    <Link class="nav-link" to='/roles' onClick={closeMobileMenu}>Roles</Link>
  </li>
  <li class="nav-item">
    <Link class="nav-link" to='/productos' onClick={closeMobileMenu}>Productos</Link>
  </li>
</ul>

        </nav>
        </>
    );
}


export default Navbar;
